import React from "react";

function SideSection(prop){
    return(
        <div className="text-light bg-dark d-flex justify-content-evenly">
            <icon>
                {prop.icon}
            </icon>
            <h5>{prop.text}</h5>
        </div>
    )
}

export default SideSection
